import logo from './logo.svg';
import './App.css';
import { Grid, Paper } from '@mui/material';
import { styled } from '@mui/material/styles';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: '#fff',
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: 'center',
  color: (theme.vars ?? theme).palette.text.secondary,
  ...theme.applyStyles('dark', {
    backgroundColor: '#1A2027',
  }),
}));

export default function PlantDashboard() {
  return (
    <div className="PhilodendronPage">
      <h1>Fauna Across the Globe</h1>
      <Grid container 
        spacing={{ xs: 2, md: 3 }} 
        sx={{
          justifyContent: "space-between",
          alignItems: "center",
          backgroundColor: 'transparent'
        }}
      >
        <Grid size={{ xs: 12, sm: 4 }}>
          <Item><img src="/images/philodendron-thumbnail.jpg" alt="Philodendron" /></Item>
          <h4>Philodendron</h4>
        </Grid>
        <Grid size={{ xs: 12, sm: 4 }}>
          <Item><img src="/images/monstera-thumbnail.jpg" alt="Monstera" /></Item>
          <h4>Monstera</h4>
        </Grid>
        <Grid size={{ xs: 12, sm: 4 }}>
          <Item><img src="/images/hoya-thumbnail.jpg" alt="Hoya" /></Item>
          <h4>Hoya</h4>
        </Grid>
      </Grid>
      <p>Ut molestie, nulla a venenatis imperdiet, purus magna mollis odio, non pharetra felis ligula in arcu. In non felis enim. Ut mollis suscipit ipsum nec mollis. Nulla convallis nulla vitae ligula volutpat, ut porta turpis dignissim. Proin gravida viverra placerat. In gravida odio non mauris porta, nec ullamcorper neque ultrices. Maecenas malesuada magna at nunc pretium sodales. Vivamus ultrices laoreet nunc vitae consectetur. Aenean at est ligula. Mauris finibus nisi ac leo aliquet, sed facilisis nulla feugiat. Mauris non ligula eu est feugiat luctus. Vestibulum a rutrum lectus. Morbi convallis erat in turpis convallis, in rutrum tellus consequat. Nullam tempus quam dui, eu venenatis odio euismod et. Etiam sed aliquet dui.</p>
    </div>
  );
}
